import React from 'react';
import '../../Styles/SupplierCard.css';

export default function SupplierCard({ supplier, onDelete }) {
  const handleDelete = () => {
    const confirmDelete = window.confirm(`Are you sure you want to delete ${supplier.name}?`);
    if (confirmDelete) {
      console.log('Delete confirmed for supplier:', supplier.id);
      onDelete(supplier.id);
    } else {
      console.log('Delete cancelled');
    }
  };

  return (
    <div className="supplier-card">
      <div className="supplier-header">
        <div className="supplier-info">
          <h3>{supplier.name}</h3>
          <p><strong>Email:</strong> {supplier.email || 'N/A'}</p>
          <p><strong>Phone:</strong> {supplier.phone || 'N/A'}</p>
          <p><strong>Address:</strong> {supplier.address || 'N/A'}</p>
        </div>
      </div>

    </div>
  );
}
